import React from 'react'
import cl from './addBtn.module.scss'

const AddBtn = () => {
  return (
    <div className={cl.addBtn__container}>
      <button type='button' className={cl.addBtn__btn}>
        ADD
      </button>
    </div>
  )
}

export default AddBtn
